export const fetchDataReducer = (state = [], action) => {
  switch (action.type) {
    case "SET_SUCCESS_RESPONSE":
      return {
        ...state,
        [action.id]: action.payload,
      };
    case "SET_FAILURE_RESPONSE":
      return {
        ...state,
        [action.id]: [action.payload],
      };
    default:
      return state;
  }
};
